import React from "react";

export default function RowTable(props) {
  const player_data = props.player_data,
    points_name = props.points_name;

  return (
    <tr>
      {/* {console.log('test',props.player_data)} */}
      <td>{player_data.PLAYER_NAME}</td>
      <td>{player_data.points_name}</td>
    </tr>
  );
}
